defmodule Coordinate do
  defstruct row: 0, col: 0

  def at(table, coordinate) do
    Enum.at(Enum.at(table, coordinate.row), coordinate.col)
  end

  def coordsForTable(table) do
    Enum.flat_map(
      0..length(table)-1, fn(row) -> Enum.map(0..length(Enum.at(table, row))-1, fn(col) -> %Coordinate{row: row, col: col} end) end)
  end
end

defimpl String.Chars, for: Coordinate do
  def to_string(coord) do
    "(#{coord.row}, #{coord.col})"
  end
end

defimpl String.Chars, for: MapSet do
  def to_string(set) do
    Enum.reduce(set, "", fn(e, a) -> a <> "#{e}," end)
  end
end

defimpl String.Chars, for: List do
  def to_string(list) do
    "[#{Enum.reduce(list, "", fn(e, a) -> a <> "#{e}," end)}]"
  end
end

defmodule Part2 do
  def countLabels(table) do
    labeledTable = labelRegions table
    Enum.reduce(
      Enum.flat_map(labeledTable, &(&1)), 
      -1, 
      fn(item, max) ->
        IO.puts "item: #{item}, max: #{max}"
        if is_integer(item) && item > max, do: item, else: max
      end
    ) + 1
  end

  def labelRegions(table) do
    Enum.reduce(
      Coordinate.coordsForTable(table), 
      table,
      fn(coord, acc) -> assignLabel acc, coord end
    )
  end

  def assignLabel(table, coord) do
    maxRow = length table
    maxCol = length (Enum.at table, coord.row)
    IO.write "row: #{coord.row}/#{maxRow}, col: #{coord.col}/#{maxCol}"

    value = Coordinate.at(table, coord)
    IO.write "value: "
    IO.puts value

    cond do
      value == false -> 
        IO.puts "Value is false; skipping"
        table
      value == true -> 
        IO.puts "Value is true; labeling"
        nodes = enumerateRegion table, coord
        label table, nodes
      # this cell is already labeled
      is_integer(value) -> table
    end
  end

  def enumerateRegion(table, coord, used \\ MapSet.new, pending \\ MapSet.new) do
    IO.puts "before neighbors: used: #{used}, pending: #{pending}"
    {used, pending} = cond do
      MapSet.member?(used, coord) ->
        {used, pending}
      Coordinate.at(table, coord) == true ->
        {MapSet.put(used, coord), MapSet.union(pending, neighbors(table, coord))}
      true -> {used, pending}
    end

    IO.puts "after neighbors: used: #{used}, pending: #{pending}"

    cond do
      MapSet.size(pending) == 0 -> used
      true ->
        newCoord = Enum.at(pending, 0)
        newPending = MapSet.delete(pending, newCoord)
        enumerateRegion(table, newCoord, used, newPending)
    end
  end

  def label(table, nodes, label \\ false) do
    label = case label do
      false -> getNextLabel table
      _ -> label
    end

    Enum.reduce(nodes, table, fn(coord, acc) -> replaceInTable(acc, coord, label) end )
  end

  def getNextLabel(table) do
    Enum.max(
      Enum.map(Enum.flat_map(table, &(&1)), 
        fn e -> 
          cond do
            is_boolean(e) -> -1
            is_integer(e) -> e
          end
        end
      )
    ) + 1
  end

  def replaceInList(list, index, newVal) do
    Enum.take(list, index) ++ [newVal] ++ Enum.drop(list, index+1)
  end

  def replaceInTable(table, coord, newVal) do
    replaceInList(table, coord.row, replaceInList(Enum.at(table, coord.row), coord.col, newVal))
  end

  def neighbors(table, coord) do
    coords = MapSet.new
    coords = if coord.row > 0, do: MapSet.put(coords, %Coordinate{row: coord.row - 1, col: coord.col}), else: coords
    coords = if coord.col > 0, do: MapSet.put(coords, %Coordinate{row: coord.row, col: coord.col - 1}), else: coords
    coords = if coord.row < length(table) - 1, do: MapSet.put(coords, %Coordinate{row: coord.row + 1, col: coord.col}), else: coords
    coords = if coord.col < length(Enum.at(table, coord.row)) - 1, do: MapSet.put(coords, %Coordinate{row: coord.row, col: coord.col + 1}), else: coords
    coords
  end

